import React from "react";
import { Routes, Route, BrowserRouter } from 'react-router-dom';
import Home from './routes/Home'
import Project from './routes/Project'
import Err404 from './routes/Err404'

function App() {
  return (
          <Routes>
            <Route exact path='/digital-portfolio-projects' element={<Home/>}/>
            <Route exact path='/project' element={<Project />}/>
            <Route exact path='/project/:name'  element={<Project />}/>
            <Route exact path='/project/:name'  element={<Project {...props } />}/>
            <Route exact path='/404'  render={props => <Err404 {...props } />}/>
          </Routes>
  );
}

//Pages
//Layout - links
//Routing

export default App;
